import { StyleFooter } from "../styles";

const Footer = () => {
    constfooterItemArr = [
        {
        cardTitle:"Packages",
        menuListArr:[
            "Mikolo",   "Corperate Branding", "Digital Marketing", "UI Design", "Public Relation"         
        ]
    }]
  return (<StyleFooter>
        constfooterItemArr.map((footerInfo)) => <FooterItemTop/>
        <div className="footer_bottom"></div>
  </StyleFooter>);
};


const FooterItemTop = ({}) =>{
    return(
        <div className="footer_top">
        <div className="footer_card">
            <h3 className="card_title"></h3>
            <ul className="footer_items">
                <li className="menu_item"></li>
                <li className="menu_item"></li>
                <li className="menu_item"></li>
                <li className="menu_item"></li>
                <li className="menu_item"></li>
            </ul>
        </div>
    </div>
    )
}

export default Footer;
